function createPDF(userStoredData, nuevaTransaccion) {
  const { jsPDF } = window.jspdf;

  // Default export is a4 paper, portrait, using millimeters for units
  const doc = new jsPDF();
  const imageLogo =
    "data:image/png;base64,";
  doc.addImage(imageLogo, 70, 20, 75, 45);

  // Datos del recibo
  const data = [
    userStoredData,
    nuevaTransaccion.tipo,
    "$" + JSON.stringify(nuevaTransaccion.monto),
    JSON.stringify(nuevaTransaccion.fecha),
  ];
  const headers = ["Nombre", "Transaccin", "Monto", "Fecha"];

  const startX = 10;
  const startY = 90;
  const cellHeight = 15;

  // Ancho de las columnas
  const columnWidths = [60, 30, 30, 70]; // Ajusta el ancho de cada columna segn sea necesario

  // Tamao de fuente
  const fontSize = 12; // Ajusta este valor segn sea necesario
  doc.setFontSize(fontSize);

  // Dibujar encabezados
  let currentX = startX;
  for (let j = 0; j < headers.length; j++) {
    let cellWidth = columnWidths[j];
    let y = startY;

    // Dibujar celda
    doc.rect(currentX, y, cellWidth, cellHeight);

    // Poner en negrita el texto
    doc.setFont("helvetica", "bold");

    // Dibujar ttulo centrado
    doc.text("Recibo", 100, 85);

    // Agregar texto
    doc.text(headers[j], currentX + 2, y + cellHeight / 2 + fontSize / 2);

    // Restaurar el estilo de la fuente a normal
    doc.setFont("helvetica", "normal");

    // Mover a la siguiente celda en X
    currentX += cellWidth;
  }

  // Dibujar datos
  currentX = startX;
  for (let j = 0; j < data.length; j++) {
    let cellWidth = columnWidths[j];
    let y = startY + cellHeight; // Siguiente fila

    // Dibujar celda
    doc.rect(currentX, y, cellWidth, cellHeight);

    // Agregar texto
    doc.text(data[j], currentX + 2, y + cellHeight / 2 + fontSize / 2);

    // Mover a la siguiente celda en X
    currentX += cellWidth;
  }

  //Italica
  doc.setFont("helvetica", "italic");

  // Dibujar ttulo centrado
  doc.text(
    "Gracias por usar nuestro PokeBank, te esperamos pronto! :)",
    50,
    150
  );

  doc.save("letter.pdf");
}

